#!/usr/bin/env python

from collections import Counter


def collapse(graph):
    if len(graph) == 1:
        return None
    else:
        node_degrees, edge_degrees = Counter(), Counter()

        for i, p in enumerate(graph):
            node_degrees[i+1] += 1
            node_degrees[p] += 1

        for i, p in enumerate(graph):
            edge_degrees[(i+1, p)] += node_degrees[i+1] + node_degrees[p]

        flags = set()
        unions = []

        for edge in edge_degrees.most_common()[::-1]:
            x, y = edge[0]
            if x not in flags and y not in flags:
                unions.append((x, y))
                flags.add(x)
                flags.add(y)

        for x, y in unions:
            for i, p in enumerate(graph):
                if p == x:
                    graph[i] = y

        for x, y in unions:
            graph[x-1] = -1

        graph = [n for n in graph if n >= 0]

        for x, y in unions:
            for i, p in enumerate(graph):
                if p > x:
                    graph[i] -= 1

        return graph


def solve(graph):
    i = 0

    while graph is not None:
        i += 1
        graph = collapse(graph)

    return i


def main():
    t = int(raw_input())

    for _ in range(t):
        k = int(raw_input())
        graph = [int(i) for i in raw_input().split()]

        print solve(graph)


if __name__ == "__main__":
    main()

