#include <bits/stdc++.h>

using namespace std;

const int HASH_MAXN=100001;
const int X=129;
const int MOD1=1000000009;
const int MOD2=1000000021;
int P1[HASH_MAXN];
int P2[HASH_MAXN];

struct Hash
{
    int len, val0, val1;
    Hash()
    {
        //
    }
    Hash(int val):
        len(1),
        val0(val),
        val1(val)
    {
        //
    }
    Hash operator+ (const Hash& other) const
    {
        Hash ret;
        ret.len=len+other.len;
        ret.val0=(other.val0+1LL*P1[other.len]*val0)%MOD1;
        ret.val1=(other.val1+1LL*P2[other.len]*val1)%MOD2;
        return ret;
    }
    Hash operator- (const Hash& other) const
    {
        Hash ret;
        ret.len=len-other.len;
        ret.val0=val0-1LL*P1[len-other.len]*other.val0%MOD1;
        if(ret.val0<0)
            ret.val0+=MOD1;
        ret.val1=val1-1LL*P2[len-other.len]*other.val1%MOD2;
        if(ret.val1<0)
            ret.val1+=MOD2;
        return ret;
    }
    bool operator< (const Hash& other) const
    {
        if(len!=other.len)
            return len<other.len;
        if(val0!=other.val0)
            return val0<other.val0;
        return val1<other.val1;
    }
    bool operator== (const Hash& other) const
    {
        return len==other.len && val0==other.val0 && val1==other.val1;
    }
    bool operator!= (const Hash& other) const
    {
        return !(*this==other);
    }
};

Hash make_hash(int v)
{
    Hash ret;
    ret.val0=ret.val1=v;
    ret.len=1;
    return ret;
}

void init_hash()
{
    P1[0]=1;
    for(int i=1; i<HASH_MAXN; i++)
        P1[i]=1LL*P1[i-1]*X%MOD1;
    P2[0]=1;
    for(int i=1; i<HASH_MAXN; i++)
        P2[i]=1LL*P2[i-1]*X%MOD2;
}

static int _hash_initialized=(init_hash(), 0);

int N, Q;
char S[100003];
Hash L[100003], R[100003];

void answer(bool b)
{
    if(b)
        printf("Yes\n");
    else
        printf("No\n");
}

Hash getLR(int a, int b)
{
    return L[b]-L[a-1];
}

Hash getRL(int a, int b)
{
    return R[a]-R[b+1];
}

int main()
{
    scanf("%s", S+1);
    N=strlen(S+1);
    for(int i=1; i<=N; i++)
        L[i]=L[i-1]+make_hash(S[i]);
    for(int i=N; i>=1; i--)
        R[i]=R[i+1]+make_hash(S[i]);
    scanf("%d", &Q);
    int a, b, c, d;
    while(Q--)
    {
        scanf("%d%d%d%d", &a, &b, &c, &d);
        int l=d-c+1;
        if(b<c || d<a)
            answer((L[c+l/2-1]-L[c-1])==(R[d-l/2+1]-R[d+1]));
        else if(c<=a && b<=d)
        {
            int a0=a-c;
            int a1=l/2-a0;
            Hash x=L[c+a0-1]-L[c-1];
            x=x+(R[b-a1+1]-R[b+1]);
            int a2=d-b;
            int a3=l/2-a2;
            Hash y=R[d-a2+1]-R[d+1];
            y=y+(L[a+a3-1]-L[a-1]);
            answer(x==y);
        }
        else if(c<=a && a<=d && d<=b)
        {
            Hash x, y;
            int e=c+l/2-1;
            int f=d-l/2+1;
            if(a<=f)
            {
                int a0=f-a;
                int a1=d-a;
                y=getLR(b-a1, b-a0);
            }
            else
                y=getLR(b-(d-a)+1, b)+getRL(f, a-1);
            if(a<=f)
                x=getLR(c, a-1)+getRL(b-(e-a), b);
            else
                x=getLR(c, e);
            answer(x==y);
        }
        else if(a<=c && c<=b && b<=d)
        {
            Hash x, y;
            int e=c+l/2-1;
            int f=d-l/2+1;
            if(b>=e)
            {
                int a0=b-e;
                int a1=b-c;
                x=getLR(a+a0, a+a1);
            }
            else
            {
                int a0=e-b;
                int a1=b-c;
                x=getRL(a, a+a0)+getLR(b+1, e);
            }
            if(b>=f)
                y=getRL(b+1, d)+getLR(a, a+b-f);
            else
                y=getRL(f, d);
            answer(x==y);
        }
    }
    return 0;
}

#include <bits/stdc++.h>
using namespace std;
#define debug(arr,sz) for(int i = sz-1; i >= 0 ; --i) cerr << arr[i] << " "; cerr << endl;
typedef long long LL;
LL A[100],sum[100],N,Num,ans;

LL power(LL a,LL b){
    LL res = (b == 0) ? 1 : power(a,b/2);
    res *= res, res *= (b & 1) ? a : 1;
    return res;
}

LL func(LL st,LL id,LL strict,LL val,bool isValid){
    if (id == 0) return 0LL;
    if (st != 0) isValid = true;
    if (isValid and st == val){
        LL res;
        if (strict) res = (sum[id-1]+1LL);
        else res = power(10LL,id-1);
        //cerr << st << " " << id << " " << strict << " returning " << res << endl;
        return res;
    }

    LL Mem = 0;
    LL mx = (strict) ? A[id-1] : 9;

    LL new_st = (val == 1) ? 2 : 1;
    if (strict == 0){
        Mem += func(0,id-1,0,val,isValid);
        LL ct = mx - (val != 0);
        Mem += (ct)*func(new_st,id-1,0,val,isValid);
        if (val != 0)
            Mem += func(val,id-1,0,val,isValid);
    } else {
        if (mx > 0){
            Mem += func(0,id-1,0,val,isValid);
            LL ct = 0,nw;
            for(int i = 1; i < mx; ++i)
                if (i != val) ++ct, nw = i;
            if (ct != 0)
                Mem += ct*(func(nw,id-1,0,val,isValid));
            if (val != 0 and val < mx)
                Mem += func(val,id-1,0,val,isValid);
        }
        Mem += func(mx,id-1,1,val,isValid);
    }
    //cerr << st << " " << id << " " << strict << " returning " << Mem << endl;
    return Mem;
}

LL Brute(LL num,LL id){
    LL ct = 0;
    for(LL i = 1; i <= num; ++i){
        LL k = i;
        while(k > 0)
            if (k%10 == id){
                ++ct; break;
            } else k /= 10;
    }
    return ct;
}

void solve(){
    cin >> Num;
    int sz = 1;
    ans = 0;
    for(LL i = Num; i > 0; i /= 10, ++sz)
        A[sz] = i%10;
    sum[1] = A[1];

    LL pro = 10LL;
    for(int i = 2; i < sz; ++i, pro *= 10LL)
        sum[i] = A[i]*pro + sum[i-1];
    //debug(sum,sz);
    --sz;
    LL x = 0, y = Num*10LL;
    for(LL i = 0; i < 10; ++i){
        ans = 0;
        for(LL j = 0; j < A[sz]; ++j)
            ans += func(j,sz,0,i,false);
        ans += func(A[sz],sz,1,i,false);
        x += ans;
        //cerr << "For " << i << " " << ans << endl;
        //LL chk = Brute(Num,i);
        //if (chk != ans)
        //    cerr << "Error for value " << i << " ",
        //    cerr << "Expected " << chk << " Found " << ans << endl;
        //cerr << ans << " AT " << i << endl;
    }

    LL g = __gcd(x,y);
    x /= g, y /= g;
    cout << x << "/" << y << endl;
}

int main()
{
    int t; cin >> t;
    while(t--) solve();
    return 0;
}

