int t, k, cc; string s;

bool isbal() {
    stack<char> st;
    for(int i = 0; i < s.sz(); ++i) {
        if(s[i] == '(')
            st.push(s[i]);
        else
            st.pop();
        if(st.empty())
            ++cc;        
    }
    if(st.empty())
        return true;
    return false;
}

int main() {
    ios_base::sync_with_stdio(0);
