    cin >> t;
    while(t--) {
        cin >> s;
        cin >> k;
        cc = 0;
        if(!isbal()) {
            if(k == 1)
                cout << s << '\n';
            else
                cout << -1 << '\n';
        }
        else {
            if(cc == 1) {
                if(k > 2)
                    cout << -1 << '\n';
                else if(k == 1) {
                    bool rem = false;
                    for(int i = 0; i < s.sz(); ++i) {
                        if(s[i] == ')' && (rem == false))
                            rem = true;
                        else
                            cout << s[i];
                    }
                    cout << '\n';
                }
                else {
                    for(int i = 1; i < s.sz(); ++i)
                        cout << s[i];
                    cout << '\n';
                }
            }
            else {
                int l = 0;
                rep(i, s.sz()) {
                    if(s[i] == ')')
                        ++l;
                }
                int r = l;
                if(k > (l+r))
                    cout << -1 << '\n';
                else {
                    if(k <= l) {
                        int tl = 0;
                        for(int i = 0; i < s.sz(); ++i) {
                            if(s[i] == ')') {
                                ++tl;
                                if(tl == k) {
                                    continue;
                                }
                            }
                            cout << s[i];
                        }
                        cout << '\n';
                    }
                    else {
                        int tr = 0;
                        k -= l;
                        //cout << "k: " << k << endl;
                        int xx = s.sz();
                        --xx; string ans;
                        for(int i = xx; i >= 0; --i) {
                            if(s[i] == '(') {
                                ++tr;
                                if(tr == k) {
                                    continue;
                                }
                            }
                            ans += s[i];
                        }
                        reverse(ans.begin(), ans.end());
                        cout << ans;
                        cout << '\n';    
                    }
                }
            }
        }
    }
    return 0;
}

