template<typename T>
T getNum(){
	T res=0;
	char c;
	while(1){
		//c=getchar();
		c = getchar_unlocked();
		if(c==' ' || c=='\n') continue;
		else break;
	}
	res=c-'0';
	while(1){
		//c=getchar();
		c = getchar_unlocked();
		if(c>='0' && c<='9') res=10*res+c-'0';
		else break;
	}
	return res;
}

string getString()
{
    string i = "";
    while(1)
    {
    	char t = getchar_unlocked();
    	if(t == '\n' || t == ' '){
    		break;
    	}
    	i += t;
    }
    return i;
}

