        for(int j=0;j<n+1;j++)
            A[0][j]=0;
        for(int j=0;j<m+1;j++)
            A[j][0]=0;
        if(m == 1)
            res = n;
        else if(n == 1)
            res = m;
        else{
        for(int j=1;j<=m;j++){
            for(int k=1;k<=n;k++){
                if((j == 1 && k == 1) || (j == m && k == n)){
                    A[j][k]=1;
                    res+=A[j][k];
                }
                else if(j == m){
                    A[j][k]=A[j-1][k]/2+A[j][k-1];
                    res+=A[j][k];
                }
                else if(k == n){
                    A[j][k]=A[j-1][k]+A[j][k-1]/2;
                    res+=A[j][k];
                }
                else{
                    A[j][k]=(A[j-1][k]+A[j][k-1])/2;
                    res+=A[j][k];
                }
            }
        }
        }
        cout<<res<<endl;
