int inverted(int x,int n)
{int a[n],p,res=0,pro=1;

for(int i=0;i<n;i++)
{
a[n-i-1]=(x%2);
x/=2;
}

for(int i=0;i<n/2;i++)
{
p=a[i];
a[i]=a[n-i-1];
a[n-i-1]=p;
}

for(int i=0;i<n;i++)
{
res+=pro*a[n-i-1];
pro*=2;
}
return res;
}

