#define MAX 1e9
#define max(a, b) ((a>b)?a:b)
#define min(a, b) ((a<b)?a:b)

int main (){
	int T, M, t;
	double p, mny, chef, opp, nxt;
	scanf ("%d", &T);
	while (T--){
		scanf ("%d %lf", &M, &p);
		t = M-1;
		mny = MAX*pow (p, t);
		if (t%2){
			opp = mny;
			chef = 0;
		}
		else{
			opp = 0;
			chef = mny;
		}
		nxt = mny/p;
		t--;
		while (t>=0){
			if (t%2){
				if (nxt-chef>opp)
					opp = nxt-chef;
			}
			else{
				if (nxt-opp>chef)
					chef = nxt-opp;
			}
			mny = nxt;
			nxt = mny/p;
			t--;
		}
		printf("%lf %lf\n", chef, opp);
	}
	return 0;
}

