inline ll abs(ll a, ll b) {

	return (a-b)>0?(a-b):(b-a);
}

int main() {

	ios_base::sync_with_stdio(false);

	ll t, n, k, i, ways, sum;

	vector<ll> arr;
	vector<ll> :: iterator it,it1, beg, end;

	inp(t);

	while(t--) {

		inp(n);
		inp(k);

		arr.resize(n);
		beg = arr.begin();
		end = arr.end();

		rep(it,beg,end)
			inp(*it);

		if(n==2) {

			ways = 1;
			sum = abs(k,arr[0] + arr[1]);
		}
		else {

			sort(arr.begin(),arr.end());

			sum = abs(k,arr[0] + arr[1]);

			rep(it,beg,end) {

				rep(it1,it+1,end) {

					if(sum == abs(k, *it + *it1))
						ways++;
					else if(sum > abs(k, *it + *it1)) {

						sum = abs(k, *it + *it1);
						ways = 1;
					} 
				}
			}
		}

		write(sum);
		pc(' ');
		write(ways);
		pc('\n');
	}

	return 0;
}

