int get(int x, int y, int x2, int y2){
	int res = sum[x2][y2];
	if(x)
		res -= sum[x - 1][y2];
	if(y)
		res -= sum[x2][y - 1];
	if(x && y)
		res += sum[x - 1][y - 1];
	return res;
}

