int main() {
    ios_base :: sync_with_stdio(0);
    cin.tie(0);     

    scanf("%d", &n);
    forn(i, 1, n + 1) {
        scanf("%d%d", &a[i], &b[i]);
    }    
    forn(i, 1, n) {
        d[a[i] * b[n + 1] - b[i] * a[n + 1]] = 1;
        u[a[i] * b[n + 1] - b[i] * a[n + 1]] = 1;
        q.push(a[i] * b[n + 1] - b[i] * a[n + 1]);
    }

    while(q.size()) {
        int v = q.front();
        q.pop();
        forn(i, 1, n) {
            int to = v + (a[i] * b[n + 1] - b[i] * a[n + 1]);
            if (abs(to) > N * N)
                continue;
