#define infinity 9999
using namespace std;
int DP[200005][205], weight[205][205], word[200005], M, N;

int RECURSE(int current_position, int previous){

	if(current_position == N)
		return 0;

	if(DP[current_position][previous - 1] != infinity)
		return DP[current_position][previous - 1];

	int k = 0, i;
	int *count2 = new int[205];
	for(i = 0; i < 205; i ++)
		count2[i] = infinity;
	for(i = previous - 1; i < M; i ++)
			if(weight[word[current_position] - 1][i] < infinity){
				count2[k] = weight[word[current_position] - 1][i] + RECURSE(current_position + 1, i + 1);
				k ++;
			}
	DP[current_position][previous - 1] = *min_element(count2, count2 + 205);
	delete [] count2;
	return DP[current_position][previous - 1];
}
int main(){
	int T;
	cin>>T;
	while(T --){
		int K, i, k, j;
		for(i = 0; i < 200005; i ++)
			for(j = 0; j < 205; j ++){
				DP[i][j] = infinity;
			}

		for(i = 0; i < 205; i ++)
			for(j = 0; j < 205; j ++)
				weight[i][j] = infinity;

		cin>>M>>K>>N;

		for(i = 0; i < K; i ++){
			int x, y;
			cin>>x>>y;
			weight[x - 1][y - 1] = weight[y - 1][x - 1] = 1;
		}

		for(i = 0; i < N; i ++)
			cin>>word[i];

		for(i = 0; i < M; i ++)
			weight[i][i] = 0;

		for(k = 0; k < M; k ++)
			for(i = 0; i < M; i ++)
				if(weight[i][k] != infinity)
					for(j = 0; j < M; j ++)
						if(weight[k][j] != infinity)
							weight[i][j] = 1;

		for(i = 0; i < M; i ++)
			weight[i][i] = 0;

		int count1 = RECURSE(0, 1);
		if(count1 >= infinity)
			cout<<-1<<endl;
		else
			cout<<count1<<endl;
	}
	return 0;
}

#include <bits/stdc++.h>
using namespace std;

#define in(a) scanf("%d",&a)

struct node {
    int val, priority, size;
    bool rev;
    node *l,*r;

};

node* init(int x)   {
    node* t=new node;
    t->val=x;
    t->rev=0;
    t->priority=rand()%1000;
    t->size=1;
    t->l=NULL;
    t->r=NULL;
    return t;
}

int sz(node* t) {
    if(!t) return 0;
    else return t->size;
}

void update_sz(node* t) {
    if(t) t->size=1+sz(t->l)+sz(t->r);
}

void lazy(node* t) {
    if(!t) return;
    else if(t->rev) {
        t->rev^=1;
        swap(t->l, t->r);
        if(t->l) t->l->rev^=1;
        if(t->r) t->r->rev^=1;
    }
}

void split(node* T, node* &L, node* &R, int k)     {
    lazy(T);
    if(!T) L=R=NULL;
    else if(1+sz(T->l)<=k) split(T->r, T->r, R, k-1-sz(T->l)), L=T;
    else split(T->l, L, T->l, k), R=T;
    update_sz(T);
}

void merge(node* &T, node* L, node* R)  {
    lazy(L), lazy(R);
    if(!L) T=R;
    else if(!R) T=L;
    else if(L->priority>R->priority) merge(L->r, L->r, R), T=L;
    else merge(R->l, L, R->l),T=R;
    update_sz(T);
}

void Traverse(node* x) {
    if(!x)return;
    Traverse(x->l);
    cout<<x->val<<" ";
    Traverse(x->r);
}



int main() {
    srand(42);
    node* root=init(1);
    int N,M;
    in(N); in(M);
    for(int i=2;i<=N;i++)   {
//        Traverse(root);
//        cout<<endl;
        merge(root, root, init(i));
    }
//    Traverse(root);
    int a, b, c;
    while(M--)  {
        in(a); in(b); in(c);
        node *A, *B, *C;
        split(root, A, root, a);
        split(root, B, root, b);
        merge(root, A, root);
        split(root, C, root, c);
        if(B) B->rev^=1;
        merge(root, B, root);
        merge(root, C, root);
    }
    Traverse(root);
    cout<<endl;

    return 0;
}

