#include <stack>
using namespace std;

struct node
{
       char name[15];
       long long int no_ex;
       int no_books;
};

int main()
{

    stack<node> s;
    node ss, t;
    long long int n, num;
    scanf("%lld", &n);

    while(n--) {
               scanf("%lld", &num);
               if (num != -1) {
                  scanf("%s", ss.name);
                  if (s.empty() == false) {
                     t = s.top();
                     if (num != 0) {
                     if (num > t.no_ex) {
                        t.no_books++;
                        s.pop();
                        s.push(t);
                     } else if(num != 0) {
                        ss.no_ex = num;
                        ss.no_books = 0;
                        s.push(ss);
                     }
                     }
                  } else {
                        if (num != 0) {
                           ss.no_ex = num;
                           ss.no_books = 0;
                           s.push(ss);
                        }
                  } 
               } else if(num == -1 && num != 0) {
                 t = s.top();
                 s.pop();
                 printf("%d %s", t.no_books, t.name);
               }
    }    

    //system("pause");
    return 0;
}

