#include <stdio.h>
#include <string.h>
#define MAXN 1005
using namespace std;

int nrt, n;
bool s[MAXN][MAXN], f[MAXN][MAXN], row[MAXN], col[MAXN];

int main()
{
    //freopen("in", "r", stdin);

    scanf("%d", &nrt);
    while(nrt--) {
        scanf("%d", &n);
        for(int i = 1; i <= n; i++)
            for(int j = 1; j <= n; j++)
                scanf("%d ", &s[i][j]);
        for(int i = 1; i <= n; i++)
            for(int j = 1; j <= n; j++)
                scanf("%d ", &f[i][j]);

        memset(row, 0, sizeof(row));
        memset(col, 0, sizeof(col));

        int sol = 0;
        for(int j = 1; j <= n; j++)
            if(s[1][j] != f[1][j]) {
                col[j] = 1;
                ++sol;
            }

        bool noSol = 0;
        for(int i = 2; i <= n; i++)
            for(int j = 1; j <= n; j++)
                if(s[i][j] ^ row[i] ^ col[j] != f[i][j]) {
                    if(row[i]) {
                        noSol = 1;
                        break;
                    }
                    else ++sol, row[i] = 1;
                }

        if(noSol) {
            printf("-1\n");
            continue;
        }

        int cntRow = 0, cntCol = 0;
        for(int i = 1; i <= n; i++) {
            cntRow += (row[i] == 1);
            cntCol += (col[i] == 1);
        }

        if(sol < 2 * n - sol || (sol == 2 * n - sol && col[1] == 1)) {
            if(!sol) {
                printf("0\n");
                continue;
            }

            printf("%d\n", cntRow);
            for(int i = 1; i <= n; i++)
                if(row[i])
                    printf("%d\n", i - 1);
            printf("%d\n", cntCol);
            for(int i = 1; i <= n; i++)
                if(col[i])
                    printf("%d\n", i - 1);
        }
        else {
            sol = 2 * n - sol;
            cntRow = n - cntRow;
            cntCol = n - cntCol;

            printf("%d\n", cntRow);
            for(int i = 1; i <= n; i++)
                if(!row[i])
                    printf("%d\n", i - 1);
            printf("%d\n", cntCol);
            for(int i = 1; i <= n; i++)
                if(!col[i])
                    printf("%d\n", i - 1);
        }
    }

    return 0;
}

