#define max(a,b) (a>b?a:b)


using namespace std;

char inp[10000000];
char *ptr;

inline int SCAN_INT(void)
{
    while(!(*ptr<='9' && *ptr>='0'))
        ptr++;
    int  ret=0;
    while(*ptr<='9' && *ptr>='0')
        ret=ret*10+(*(ptr++))-'0';
    return ret;
}

inline char SCAN_CHAR(void)
{
    while(!(*ptr<='Z' && *ptr>='A') && !(*ptr<='9' && *ptr>='0'))
        ptr++;
    return *ptr++;
}

char s[1000][1000];
char t[1000][1000];
char f[1000][1000];
int pr[2000];
vector<int> ansr;
vector<int> ansc;
int n;

int chk()
{
    for(int i=0;i<n;i++){
        int tmp = strcmp(f[i],t[i]);
        if(tmp!=0)
            return 0;
    }
    return 1;
}

void toggle(int a)
{
    if(a<=n){
        for(int i=0;i<n;i++){
            t[a-1][i]=(t[a-1][i]=='0')?'1':'0';
        }
    }
    if(a>n){
        a=a-n;
        for(int i=0;i<n;i++){
            t[i][a-1]=(t[i][a-1]=='0')?'1':'0';
        }
    }
}

int press(int count,int start)
{
    if(count==0){
        int r=chk();
        return r;
    }
    for(int i=start;i<=2*n;i++){
        if(pr[i]==1)
            continue;
        toggle(i);
        pr[i]=1;
        int t=press(count-1,i+1);
        pr[i]=0;
        toggle(i);
        if(t==1){
            if(i<=n)
                ansr.push_back(i-1);
            else
                ansc.push_back(i-n-1);
            return 1;
        }
    }
    return 0;
}

void reset()
{
   for(int i=0;i<n;i++){
        strcpy(t[i],s[i]);
    }
}

int main()
{
    //freopen("input.txt","r", stdin);
	fread(inp, sizeof(char), 10000000, stdin);
	ptr = inp;
	int t;
	t=SCAN_INT();
	while(t--){
        n=SCAN_INT();
        for(int i=0;i<n;i++){
            for(int j=0;j<n;j++){
                s[i][j]=SCAN_CHAR();
            }
            s[i][n]='\0';
        }
        for(int i=0;i<n;i++){
            for(int j=0;j<n;j++){
                f[i][j]=SCAN_CHAR();
            }
            f[i][n]='\0';
        }
        reset();
        if(chk()){
            printf("0\n");
            continue;
        }
        int i;
        for(i=1;i<=2*n;i++){
            reset();
            int tmp=press(i,1);
            if(tmp==1)
                break;
        }
        if(i>2*n){
            printf("-1\n");
            continue;
        }
        printf("%d\n",ansr.size());
        for(int i=ansr.size()-1;i>=0;i--)
            printf("%d\n",ansr[i]);
        printf("%d\n",ansc.size());
        for(int i=ansc.size()-1;i>=0;i--)
            printf("%d\n",ansc[i]);
        ansr.clear();
        ansc.clear();
	}
}

