#include<iostream>
using namespace std;
#define PRIME 1000000009

long long int modinv(int x)
{
	long long int a=PRIME,b=x;
	long long int a1=1,a2=0,b1=0,b2=1;
	while(b!=0)
	{
		long long int t1=b1,t2=b2,t=b;
		b1 = a1-(a/b)*b1;
		b2 = a2-(a/b)*b2;
		a1=t1;
		a2=t2;
		b=a%b;
		a=t;
	}
	return ((a2)%PRIME+PRIME)%PRIME;
}

int main()
{
	long long int N,K,arr[100000],num_zero,sum,T,nCk;
	cin>>T;
	while(T--)
	{
		num_zero = 0;
		cin>>N>>K;
		for(int i=0;i<N;i++)
		{
			cin>>arr[i];
			if(arr[i]==0)
				num_zero++;
		}
		if(num_zero>0)
		{
			if(K>N-num_zero)
				K=N-num_zero;

			nCk=1;sum=1;
			for(long long int i=1;i<=K;i++)
			{
				nCk = (nCk*(((N-num_zero-i+1)*modinv(i))%PRIME))%PRIME;
				sum = (sum+nCk)%PRIME;
			}
		}
		if(num_zero==0)
		{
			long long int start;
			if(K>N)
				K = N-(K-N)%2;
			if(K%2==0)
			{
				nCk=sum=1;
				start = 0;
			}
			else
			{
				nCk=sum=N;
				start = 1;
			}
			for(long long int i=start+2;i<=K;i+=2)
			{
				nCk = ((((((nCk)*(((N-i+1)*modinv(i))%PRIME))%PRIME)*(N-i+2))%PRIME)*(modinv(i-1)))%PRIME;
				sum = (sum+nCk)%PRIME;
			}		
		}
		cout<<sum<<endl;
	}	
	return 0;
}

