using namespace std;

inline void ifast(int &x)
{
    register int c = gc();
    x = 0;
    int neg = 0;
    for(; ((c<48 || c>57) && c != '-'); c = gc());
    if(c=='-')
    {
        neg = 1;
        c = gc();
    }
    for(; c>47 && c<58 ; c = gc())
    {
        x = (x<<1) + (x<<3) + c - 48;
    }
    if(neg)
        x = -x;
}

int main()
{
    int t;
    scanf("%d", &t);
    while(t--)
    {
        int k;
//        scanf("%d", &k);
        ifast(k);
        ll ans = 0;
        FOR(i, 0, k)
        {
            int n;
//            scanf("%d", &n);
            ifast(n);
            vector<int> arr(n);
            FOR(i, 0, n)
                ifast(arr[i]);
//                scanf("%d", &arr[i]);
            sort(ALL(arr));
            arr.erase(unique(ALL(arr)), arr.end());
            ll value = (1LL << 50);
            ll res = ((arr[0] & 1) == 0) ? value : -value;
            int sz = arr.size();
            bool change = false;
            FOR(i, 1, sz)
            {
                if((arr[i] & 1) != (arr[i-1] & 1))
                    change = true;
                if(change)
                    value >>= 1;
                res += ((arr[i] & 1) == 0) ? value : -value;
            }
            ans += res;
        }
        if(ans > 0)
            printf("EVEN\n");
        else if(ans < 0)
            printf("ODD\n");
        else
            printf("DON'T PLAY\n");
    }
    return 0;
}

