#define LLI long long
string a,b;
LLI A[1005][26];
LLI B[1005][26];
LLI KTH,LEN;
LLI dp[1005][1005];
LLI way[1005][1005];
LLI high=1000000009;
LLI f(LLI x, LLI y)
{

    if(x>=LEN || y>=LEN)return 0;

    LLI &ret = dp[x][y];
    if(ret!=-1)return ret;
    ret = 0;
    if(a[x]==b[y])ret =  1+ f(x+1,y+1);
    else
    {

        ret = f(x+1,y);
        ret = max(ret, f(x,y+1));

    }
    return ret;
}


LLI solve(LLI x, LLI y , LLI baki)
{

    if( baki==0 )
    {
        return 1;
    }

    LLI &ret = way[x][y];
    if(ret!=-1)return ret ;

    ret=0;
    for(LLI i=0; i<26; i++ )
    {
        LLI X = A[x][i ];
        LLI Y = B[y][i ];
        if(X<LEN && Y<LEN && baki == 1+f(X+1,Y+1)   )
        {
            ret += solve(X+1,Y+1,baki-1);
        }
ret=min(ret,high);

    }
    return ret;
}


void path(LLI x, LLI y , LLI need , LLI baki)
{


    if(baki==0)return ;

    for(LLI i=0; i<26; i++ )
    {
        LLI X = A[x][i ];
        LLI Y = B[y][i ];
        LL have=0 ;
        if(X<LEN && Y<LEN && baki == 1+f(X+1,Y+1)   ) have=solve(X+1,Y+1 , baki-1);

        if(have>=need)
        {

            cout<<char('a'+i);
            path(X+1,Y+1,need , baki-1);
            return ;

        }
        else
        {
            need-=have;
        }

    }

}



int main()
{
    cin>>LEN>>KTH;
    cin>>a>>b;
//    a=" "+a;
//    b=" "+b;
    SET(dp,-1);
    LLI lcs=f(0,0);

    SET(way,-1);



    for(LLI j=0; j<26; j++)A[LEN+1][j]=LEN+1;
    for(LLI j=0; j<26; j++)B[LEN+1][j]=LEN+1;


    for(LLI i = LEN-1; i>=0; i-- )
    {
        for(LLI j=0; j<26; j++)A[i][j]=A[i+1][j];
        for(LLI j=0; j<26; j++)B[i][j]=B[i+1][j];

        A[i][a[i]-'a' ]=i;
        B[i][b[i]-'a' ]=i;
    }


    LL w = solve(0,0,lcs);

    if(KTH>w)cout<<-1<<endl;
    else
    {

        path(0,0,KTH,lcs);
        cout<<endl;
    }
}

