bool prime[100001];

void preCompute() {
	for(int i = 0; i < 100001; i++)
		prime[i] = true;
	prime[0] = prime[1] = false;
	for(int i = 2; i < 317; i++) {
		if(prime[i]) {
			for(int j = i * i; j < 100001; j += i)
				prime[j] = false;
		}
	}
}

int main(int argc, char const *argv[]) {
	ios::sync_with_stdio(false);
	preCompute();
	int T;
	cin >> T;
	for(int i = 0; i < T; i++) {
		int N, A[100000], ans = 0, count, max_count;
		cin >> N;
		for(int j = 0; j < N; j++)
			cin >> A[j];
		int max = *max_element(A, A + N);
		for(int j = 2; j <= max; j++) {
			if(prime[j]) {
				max_count = 0;
				for(int k = 0; k < N; k++) {
					count = 0;
					if(A[k] % j == 0) {
						while(A[k] % j == 0) {
							count++;
							A[k] /= j;
						}
					}
					if(count > max_count)
						max_count = count;
				}
				ans += max_count;
			}
		}
		cout << ans << endl;
	}
	return 0;
}

