//A Home for Chef
//Problem code: CHEFHOME
//http://www.codechef.com/MAY12/problems/CHEFHOME
//http://www.codechef.com/problems/CHEFHOME
public class Main {
	public static void main(String[] args)throws Exception{
			solve();
	}

	public static void solve() throws IOException{
		Scanner fscan =  new Scanner(System.in);
		BufferedWriter bw = new BufferedWriter(new OutputStreamWriter(System.out));
		int T = fscan.nextInt();

		for(; T > 0; T--){
			long dx,dy;
			dx = dy = 1;

			int N = fscan.nextInt();
			long x[] = new long[N];
			long y[] = new long[N];
			for (int i = 0; i < N; i++) {
				x[i] = fscan.nextInt();;
				y[i] = fscan.nextInt();
			}

			if(N%2 == 0){
				Arrays.sort(x);
				Arrays.sort(y);
				dx = x[N/2] - x[N/2 -1] + 1;
				dy = y[N/2] - y[N/2 -1] + 1;
			}

			bw.append(String.valueOf(dx * dy) + "\n");
		}
		fscan.close();	
		bw.close();
	}
}

#include <cstdio>

using namespace std;

const int N = 6670, MOD = 747474747;
int n, d, a [N][6];
long long dist [N], ans = 1;

void read () {
    int i, j;

    scanf ("%d%d", &n, &d);
    for (i = 1; i <= n; i ++)
        for (j = 1; j <= d; j ++)
            scanf ("%d", &a [i][j]);
}

long long distance (const int &u, const int &v) {
    int i;
    long long D = 0;
    for (i = 1; i <= d; i ++)
        D = (long long)D + (a [u][i] - a [v][i])*(a [u][i] - a [v][i]);
    return D;
}

void apm (int node) {
    int i, newnode = 0;
    long long newdist, mindist = (1ll << 31) - 1;

    dist [node] = -1;
    for (i = 1; i <= n; i ++)
        if (dist [i] != -1) {
            newdist = distance (node, i);
            if (newdist > dist [i])
                dist [i] = newdist;
            if (newdist < mindist) {
                mindist = newdist;
                newnode = i;
            }
        }
    if (newnode) {
        ans = ((long long)ans * mindist) % MOD;
        apm (newnode);
    }
}

void solve () {
    if (n == 1)
        printf ("0\n");
    else {
        apm (1);
        printf ("%lld\n", ans);
    }
}

