long long calc(int x, int k, int n)
{
	if(x<0)
	return 0;

	else if(x==0)
	{
		if(k==0)
		return 1;
		else
		return 0;
	}
	else if(k==0)
	return 0;

	else if(x>k*arr[n])
	return 0;

	int sum=0;

	if(n-1>=0)
	sum=calc(x,k,n-1);

	sum%=1000000007;

	if(x-arr[n]>=0)
	sum+=calc(x-arr[n],k-1,n);

	return sum%1000000007;
}
