#define MOD 1000000007
long long fib[43];
void caluculatefib()
{
   fib[0]=1;
   fib[1]=2;
    for(int i=2;i<43;i++)
    fib[i]=fib[i-1]+fib[i-2];
}

long long results(long long sum,int k,int n)
{
    if(k==0)
    return (sum==0)?1:0;
    if((n==0)||(sum<=0))
    return 0;
    long long ans=0;
    for(int i=n;i>=0;i--)
    {
        if((fib[i]*k)<sum)
        break;
        ans=((ans%MOD)+(results(sum-fib[i],k-1,n-1)%MOD))%MOD;
    }
    return ans;
}
