#define Maxn 1000000
int zs[Maxn],cnt = 0,n,T;
bool f[Maxn];
void Pre_work() //
{
    memset(f,false,sizeof(f));
    for(int i=2;i<Maxn;i++)
		if(!f[i])
		{
			zs[++cnt] = i;
			for(int j=2*i;j<Maxn;j+=i)
                f[j] = true;
		}
}
void Work()
{
	long long ans,t1,t2;
    ans = 1;
    for(int i=1;(i<=cnt)&&(n>1);i++)
    {
        if(zs[i] * zs[i] > n)
            break;
        t1 = t2 = 1;
        while(n % zs[i]==0)
        {
            t2 *= zs[i];//printf("%d\n",t2);
            t1 += t2;
            n /= zs[i];
        }
        ans *= t1;//printf("%d\n",ans);
    }
    if(n > 1)
        ans *= (1 + n);
    printf("%lld\n",ans);
}
int main()
{
    Pre_work();
	for (scanf("%d",&T);T--;)
	{
		scanf("%d",&n);
        Work();
	}
	return 0;
}

