using namespace std;
int is_doubleString(char s[])
{
	int f=1;
	long long int len=strlen(s);
	for(int i=0;i<len/2;i++)
	{
		if(s[i]!=s[i+len/2])
		{
			f=0;
			break;
		}
	}
	return f;
}
int is_sub(char str1[],long long int a,long long int b,char str2[],long long int x,long long int y)
{
	long long int j=a;
	for(long long int i=x;i<=y&&j<=b;i++)
	{
		if(str1[j]==str2[i])
		j++;
	}
	return (j==b+1);
}
int main()
{
	ios::sync_with_stdio(false);
	long long int d;
	cin>>d;
	while(d--)
	{
		char s[1000001];
		int f;
		cin>>s;
		long long int l=strlen(s);
		if(l%2==0)
		f=is_doubleString(s);
		else
		{
			if(l==1)
			f=0;
			else
			{
				long long int h;
				h=l/2;
				f=is_sub(s,0,h-1,s,h,l-1)||is_sub(s,h+1,l-1,s,0,h);
			}
		}
		if(f==1)
		cout<<"YES"<<endl;
		else
		cout<<"NO"<<endl;
	}
	return 0;
}

