			_arr[k] = scanner.nextInt();
			_arr[k + 1] = scanner.nextInt();
			_arr[k + 2] = scanner.nextInt();
		}

		for (int i = 0; i < _arr.length; i+=3) {
			int count = 0;
			int h = _arr[i], w = _arr[i+1];
			int c = _arr[i+2];
			for (int j = 1; j <= h; j++) {
				if (c % j == 0 && c / j <= w)
					count++;
			}
			System.out.println(count);
		}
		scanner.close();
	}
}

