#define ll long long
const int maxn=200;
const ll Mod=1e9+7;
int s[100005],sum[100005];

ll f(ll x,ll c)
{
    if(x==0) return x;
    if(c==0) return s[x];
    if(x&1) return f(x/2+1,c-1);
    else return f(x/2,c-1)+f(x/2+1,c-1);
}

ll dfs(ll x,ll c)
{
    if(x==0) return x;
    if(c==0) return sum[x];
    if(x&1) return 3*dfs(x/2+1,c-1)-s[1]-f(x/2+1,c-1);
    else return 3*dfs(x/2,c-1)-s[1]+f(x/2+1,c-1);
}

void solve()
{
    ll n,m,a,b;
    sum[0]=0;
    scanf("%lld%lld%lld%lld",&n,&m,&a,&b);
    for(int i=1;i<=n;i++)
    {
        scanf("%lld",&s[i]);
        sum[i]=(sum[i-1]+s[i])%Mod;
    }
    ll sum1=dfs(a-1,m),sum2=dfs(b,m);
    //cout<<sum2<<' '<<sum1<<endl;
    cout<<(sum2-sum1+Mod)%Mod<<endl;
}

int main()
{
    int T;
    scanf("%d",&T);
    while(T--)
        solve();
}

