struct leaf{int val,k;}arr[100000];
bool f(leaf a,leaf b){
    return a.val<b.val;
}
int cnt[400000],k;
int query(int s,int e,int p){
    if(s>k) return 0;
    if(e<=k)    return cnt[p];
    int m=(s+e)/2;
    return query(s,m,p*2)+query(m+1,e,p*2+1);
}
void insert(int s,int e,int p){
    if(s>k || e<k)
        return;
    if(s==e){
        cnt[p]=1;
        return;
    }
    int m=(s+e)/2;
    insert(s,m,p*2);
    insert(m+1,e,p*2+1);
    cnt[p]=cnt[p*2]+cnt[p*2+1];
}
