    s = []
    for index,item in enumerate(c):
        for i in xrange(item):
            s.append(index+1)

    s.sort()
    s.reverse()
    size= len(s)
    for subset in itertools.permutations(s, size):
        count= 0
        #print subset

        for idx, item in enumerate(subset):

            if item!=idx+1:
                count+=1
            else:
                break
        if count==len(subset):
            return subset



