#define SQ(x) (x)*(x)
#define DIST(a,b) SQ(a.x-b.x)+SQ(a.y-b.y)
#define CP(p,q,r) ( ( p.x-r.x )*( q.y-r.y ) - ( q.x-r.x )*( p.y-r.y ) )

using namespace std;

struct point {
	int x, y;
};

point min_pt;

bool compare( point m, point n )
{
	int a = CP( m,n,min_pt );

	if( !a ) {
		return DIST(m,min_pt)> DIST(n,min_pt);
	} 

	return a > 0;
}

bool intersect( point p1, point p2, point p3, point p4 )
{
	int d1 = CP( p1, p3, p4 );
	int d2 = CP( p2, p3, p4 );
	int d3 = CP( p3, p1, p2 );
	int d4 = CP( p4, p1, p2 );

	if( ( d1 > 0 && d2 < 0 || d1 < 0 && d2 > 0 ) && ( d3 > 0 && d4 < 0 || d3 < 0 && d4 > 0 ) ) {
		return true;
	} else {
		return false;
	}
}

inline double solve()
{
	point pt[4];
	int i, j, k, l, z;
	int res = INT_MIN;

	FOR( i,0,3 ) {
		scanf( "%d%d", &pt[i].x, &pt[i].y ); 
	}

	FOR( i,0,3 ) {
		FOR( j,0,3 ) {
			FOR( k,0,3 ) {
				FOR( l,0,3 ) {
					if( i != j && i != k && i != l && j != k && j != l && k != l ) {
						if( !intersect( pt[i], pt[j], pt[k], pt[l] ) ) {
							point tp[4];
							tp[0] = pt[i];
							tp[1] = pt[j];
							tp[2] = pt[k];
							tp[3] = pt[l];

							FOR( z,0,3 ) {
								res = MAX( res, DIST( tp[z], tp[(z+1)%4] ) );
							}
						}
					}
				}
			}
		}
