using namespace std;
unsigned long long C(unsigned long long n,unsigned long long r) {
    if(r > n / 2) r = n - r; // because C(n, r) == C(n, n - r)
    unsigned long long ans = 1;
    int i;

    for(i = 1; i <= r; i++) {
        ans *= n - r + i;
        ans /= i;
    }

    return ans;
}
