long long int Gcd(long long int a,long long int b)
{
	if(b==0)
	return a;
	else
	return Gcd(b,a%b);
}
int main()
{
	long long int test,n,i,ans,k,gcd;
	cin>>test;
	while(test--)
	{
		cin>>n>>k;
		ans=1; i=1;
		while(i<=k)
		{
			gcd=Gcd(ans,i);
			ans/=gcd;
			ans*=(n-i+1);
			ans/=(i/gcd);
			i++;
		}
		if(k>n)
		cout<<"0\n";
		else
		cout<<ans<<endl;
	}
	return 0;
}

#include<stdio.h>
typedef unsigned long long ll;
ll gcd(ll a,ll b)
{
//	if(b==0ll)return a;
//	else return gcd(b,a%b);
	ll t=0ll;
	while (b>0ll)
	{
		t=a%b;
		a=b;
		b=t;
	}
	return a;
}

ll C(ll n, ll k)
{
	ll res = 1ll;
	if ( k > n - k )
		k = n - k;
	for (ll i = 1ll; i <= k; ++i)
	{
		ll num=gcd(res,i);
		res /= num;
		res *= (n-i+1ll)/(i/num);
	}
	return res;
}

int main()
{
	int t;
	scanf("%d",&t);
	while(t--) {
		ll n,k;
		scanf("%llu%llu",&n,&k);
		printf("%llu\n",C(n,k));
	}
	return 0;
}

