		scanf("%d%d", &N, &M);
		for(int i = 1;i <= M;++i){
			scanf("%d", &orders[i]);
		}
		for(int i = M;i >= 1;--i){
			lst[orders[i]].push_back(i);
		}
		memset(occ, 0, sizeof occ);
