					for(int j = 1;j <= 400;++j){
						if(occ[j]){
							if(lst[j].empty()){
								maxId = j;
								break;
							} else if(lst[j][lst.size() - 1] > maxVal){
								maxVal = lst[j][lst.size() - 1];
								maxId = j;
