#include <stdio.h>

int fact (long int n)
{
	if(n==1 ||n==0)
	return 1;
	else
	return n*fact(n-1);
}
int bin(long int n)
{
	int i,n1,c=0;
	while(n>0)
	{
		n1=n%2;
		if(n1==1)
		c++;
		n=n/2;
	}
	return c;
}
int main(void) {
	// your code goes here
	long int i,n,t,n1,n2,temp,fn1,fn2,count,b,g ;
	scanf("%ld",&t);
	while(t--)
	{
		count=0;
		scanf("%ld %ld",&n,&g);
		for(i=0;i<=n;i=i+2)
		{
			n1=n-i;
			n2=i/2;
			temp=fact(n1+n2);
			fn1=fact(n1);
			fn2=fact(n2);
			temp=temp/fn1;
			temp=temp/fn2;
			count=count+temp;
			count=count%1000000007;
			b=bin(count);
		}
		if(b==g)
		printf("CORRECT\n");
		else
		printf("INCORRECT\n");
	}
	return 0;
}

