inline void si(int* x)
{
	register char c = getchar_unlocked();
	*x = 0;
	int neg = 0;
	for(; ((c<48 || c>57) && c != '-');c = getchar_unlocked());
	if(c=='-') {
        neg = 1;
        c = getchar_unlocked();
    }
	for(; (c>47)&&(c<58);c = getchar_unlocked())
		*x = (int)((((*x)<<1) + ((*x)<<3)) + c - 48);
    if(neg)
        *x = -*x;
}
int main()
{
    int t,ds,dt,d;
    si(&t);
    while(t--)
    {
       si(&ds);
       si(&dt);
       si(&d);
       d=d-ds-dt;
       if(d>0)
        printf("%d\n",d);
       else
        printf("0\n");
    }
    return 0;
}

