            B.push_back(t);
            //cout<<"Inserting "<<B[B.size()-1].a<<" "<<B[B.size()-1].b<<" "<<B[B.size()-1].c<<endl;
        }

        while(m2--)
        {
            //cout<<m2<<endl;
            cin>>a>>b>>c;
            node t(a, b, c);
            A.push_back(t);
            //cout<<"Inserting "<<A[A.size()-1].a<<" "<<A[A.size()-1].b<<" "<<A[A.size()-1].c<<endl;
        }
        coalScam(A, B, n);
    }
    return 0;
}

