#define MAX 50005
int rank[MAX];
int parent[MAX];

typedef pair<int,int> pii;
typedef pair<int,pii> edge;

int find(int n) {
	if(parent[n] != n) parent[n] = find(parent[n]);
	return parent[n];
}
bool merge(int a,int b) {
	int pa = find(a), pb = find(b);
	if(pa==pb) return 0;
	if(rank[pa] > rank[pb]) parent[pb] = pa;
	else parent[pa] = pb;
	if(rank[pa] == rank[pb]) rank[pb]++;
	return 1;
}


