void solve(int i,int k,int d,long long sum)
{
      if(i==N)
      {
        if(k!=K)
             return ;
        ma = max(ma,sum);
        dp[i][k][d] = ma;
        return ;
      } 
      if(dp[i][k][d]!=-1)
      {
        ma=max(dp[i][k][d],ma);    
      }

      if(d<D)
      {
        solve(i+1,k,d+1,sum+(M*A[i]));
        dp[i][k][d]=ma;
      }
      else
      {
        solve(i+1,k,d+1,sum+(A[i]));
        dp[i][k][d]=ma;
      }
      solve(i+1,k+1,0,sum);
       dp[i][k][d]=ma;
}
