typedef long long int LL;
const int mod = 1000000007;
const int N = 1<<20;
LL A[N], B[N], C[N];

int main() {
	int n;
	S(n);
	rep(i,0,1<<n) SL(A[i]);
	rep(i,0,1<<n) SL(B[i]);
	rep(i,0,1<<n) SL(C[i]);

	rep(j,0,n) rep(i,0,1<<n) {
		 if((i>>j)&1) {
			A[i] += A[i-(1<<j)];
			B[i] += B[i-(1<<j)];

			if(A[i] >= mod) A[i] -= mod;
			if(B[i] >= mod) B[i] -= mod;
		}
	}

	rep(i,0,1<<n) {
		A[i] *= B[i];
		A[i] %= mod;
	}

	rep(j,0,n) rep(i,0,1<<n) {
		 if((i>>j)&1) {
			A[i] -= A[i-(1<<j)];
			if(A[i] < 0) A[i] += mod;
		}
	}

	memcpy(B, C, sizeof(C));

	rep(j,0,n) rep(i,0,1<<n) {
		 if((i>>j)&1) {
			A[i] += A[i-(1<<j)];
			B[i] += B[i-(1<<j)];

			if(A[i] >= mod) A[i] -= mod;
			if(B[i] >= mod) B[i] -= mod;
		}
	}

	rep(i,0,1<<n) {
		A[i] *= B[i];
		A[i] %= mod;
	}

	rep(j,0,n) rep(i,0,1<<n) {
		 if((i>>j)&1) {
			A[i] -= A[i-(1<<j)];
			if(A[i] < 0) A[i] += mod;
		}
	}
	LL ans = 0;
	rep(i,0,1<<n) {
		ans += A[i] * (1 << __builtin_popcount(i));
		ans %= mod;
	}
	printf("%lld\n",ans);
	return 0;
}

