int M = 1000000007;

long long int mypow(int n, int p)
{
    long long int retval = 1;
    long long int temp = p;

    while(n!=0)
    {
        if(n%2==1)
        {
            retval = (retval*temp)%M;
            temp = (temp*temp)%M;
        }
        else
        {
            temp = (temp*temp)%M;
        }
        n = n/2;
    }

    return retval;
}

