string point_visited(int x,int y)
{
	if((x==0 && y==0) || (x==1 && y==0))
		return "YES";
	if((x>0 && abs(x)%2==1) || (x<0 && abs(x)%2==0) )
	{
		//cout<<"xxx"<<endl;
		if(abs(x)%2==1)
		{//cout<<"xxxeven x="<<x<<"  y="<<y<<endl;
			if(((-1*(x-1))<=y) && (y<=(x+1))){//cout<<"xxx y in x range"<<endl;
				return "YES";}

		}
		else
		{
			if(x<=y && y<=-(x))
				return "YES";
		}
	}
	if(abs(y)%2==1)
		return "NO";
	if(y>0)
	{
		if(-(y)<=x && x<=(y+1))
			return "YES";
	}
	else	
		if((y)<=x && x<=(-1*(y)+1))
			return "YES";
	return "NO";
}

