void mul(ll a[][3],ll b[][3])
{
    ll res[3][3];
    memset(res,0,sizeof(res));
    int i,j,k;
    for(i=0;i<3;i++)
        for(j=0;j<3;j++)
           for(k=0;k<3;k++)
              res[i][j] = (res[i][j] + a[i][k]*b[k][j])%mod;
    for(i=0;i<3;i++)
        for(j=0;j<3;j++)
    a[i][j]=res[i][j];
}
ll power1(ll n)
{
    ll f[3][3] = {{1,1,0},{1,0,1},{1,0,0}};
    ll tmp[3][3] = {{4,2,1},{0,0,0},{0,0,0}};
    while(n)
    {
        if(n&1)
        mul(tmp,f);
        mul(f,f);
        n=n>>1;
    }
    return tmp[0][0]%mod;
}
