	return ret;
}

matrix pow(matrix A,int p){
	if(p==1)return A;
	if(p&1){
        matrix temp=pow(A,p/2);
		return mul(A,mul(temp,temp));
	}else{
        matrix temp=pow(A,p/2);
		return mul(temp,temp);
	}
}

