map<int,int> L;


void preproL(){

    int64 ac = 0;
    int pos =0;

    L[0]=0;

    FORIT(it, L){
        ac += it->snd;
        ac = ac&1LL;
        it->snd = ac;

    }

    L[ 1000000005 ]=ac;

    //mapeo.pb( 1000000005 );
    //LL[pos] = ac;     
}




int opera(int i, int j){

    if(A[i]>=A[j] ) return i;
    return j;

}



void preproA(){

    FOR(i,n) MM[i][0]=i;

    FOR(j,20){    
    int ii = 1<<j;
    for(int i =0; ii < n ; i++, ii++ ){
        MM[i][j+1] = opera( MM[i][j] , MM[ii ][ j ]  );    
    }
    }
}



int posMAX(int ini, int fin){

    int dif = fin-ini+1;

    int cnt = log(dif)/log(2);

    return opera(  MM[ini][cnt] , MM[fin-(1<<cnt)+1][cnt]   );    

}



void sol(int i, int j){
    if(i>j) return ;
    int ind = posMAX(i,j);
    L[ A[ ind  ] ] +=  ((ind-i+1)%2)*((j-ind+1)%2);   

    sol(i,ind-1);
    sol(ind+1,j);

}


int64 change( char op, int x ){

    map<int, int> ::iterator it;

    if( op=='=' ){
        it = L.find(x);

        if( it != L.end() ){
            int64 ans = it->snd;
            it--;
            ans -= it->snd;

            return (ans+2)%2;
        }  
        else return 0;    
    }    

    if(op=='>'){
        it = L.lower_bound( x+1 );
        it--;
        return (n*1LL*(n+1))/2 - it->snd;

    }
    if(op=='<'){
        it = L.lower_bound( x );
        it--;
        return it->snd;    
    }

}


