    sol(0,n-1);


    preproL();

    FOR(i,m){
        scanf("%s %d %s",op, &x, emp );



        if( ! (change( op[0], x )&1LL) ){
            printf("%c", emp[0]=='D'?'C':'D'  ); 
        }
        else{
            printf("%c",emp[0]);
        }

    }
    printf("\n");


    return 0;
}

#include<bits/stdc++.h>
using namespace std;
#define ll long long int
ll n,m;
pair<ll,ll> p[1000005];
char rev(char init)
{
    if(init=='D')
        return 'C';
    else  return 'D';
}
ll find_k(ll k)
{
    ll i=0,j=n+1;
    while(i<j-1)
    {
        int mid=(i+j)/2;
        if(p[mid].first<=k)
            i=mid;
        else
            j=mid;
    }
    return p[i].second;
}
int main()
{
    std::ios::sync_with_stdio(false);
    scanf("%lld %lld",&n,&m);
    ll a[n+1],left[n+1],rgt[n+1];
    for(ll i=1; i<=n; i++)
        scanf("%lld",&a[i]);
    stack<ll> s,s1;

    for(ll i=1; i<=n; i++)
    {
        while(!s.empty() && a[s.top()]<=a[i])
        {
            s.pop();
        }
        if(s.empty())
            left[i]=0;
        else
            left[i]=s.top();

        s.push(i);
    }

    for(ll i=n; i>0; i--)
    {
        while(!s1.empty() && a[s1.top()]<a[i])
        {
            s1.pop();
        }
        if(s1.empty())
            rgt[i]=n+1;
        else
            rgt[i]=s1.top();

        s1.push(i);
    }//
    p[0].first=-1*INT_MAX;
    p[0].second=0;
    for(ll i=1; i<=n; i++)
    {
        p[i].first=a[i];
        p[i].second= (i-left[i])*(rgt[i]-i);
    }
    sort(p,p+n+1);


    for(ll i =1; i<=n; i++)
        p[i].second+=p[i-1].second;
    string res="";
    while(m--)
    {
        char c,pl;
        ll num;
        cin>>c;
        cin>>num;
        cin>>pl;
        if(c=='>')
        {
            ll x,ans=0;
            x=find_k(num);
            ans=(n*(n+1))/2-x;
            if(ans%2==1)
            {
                res+=pl;
            }
            else
                res+=rev(pl);
        }
        else  if(c=='<')
        {
            ll x,ans=0;
            x=find_k(num-1);
            if(x%2==1)
            {
                res+=pl;
            }
            else
                res+=rev(pl);
        }
        else
        {
            ll x=find_k(num)-find_k(num-1);
            if(x%2==1)
            {
                res+=pl;
            }
            else
                res+=rev(pl);
        }

    }
    cout<<res<<endl;
}

#include <algorithm>
#include <stdio.h>
#include <vector>
#define  fi        first
#define  se        second
#define  maxn      1000003
#define  pb        push_back
using    namespace std;
typedef  long long LL;
typedef  pair<int,LL> pi;

int n,m;
LL sum[maxn];
int p2[maxn];
int dp[maxn][20];
vector<pi>v;

bool check(int l , int r , int x)
{
  int t=p2[r-l+1];
  if(max(dp[l][t],dp[r-(1<<t)+1][t])==x)
    return true;
  return false;
}

int main()
{
  scanf("%d%d",&n,&m);
  for(int i=1 ; i<=n ; i++)
    scanf("%d",&dp[i][0]);
  for(int k=1 ; (1<<k)<=n ; k++)
    for(int i=1 ; i+(1<<k)-1<=n ; i++)
      dp[i][k]=max(dp[i][k-1],dp[i+(1<<(k-1))][k-1]);
  for(int i=0 ; (1<<i)<=n ; i++)
    p2[(1<<i)]=i;
  for(int i=3 ; i<=n ; i++)
    if(!p2[i])
      p2[i]=p2[i-1];
  for(int i=1 ; i<=n ; i++)
  {
    int l1=1,r1=i,p1=i;
    while(l1<=r1)
    {
      int mid=(l1+r1)>>1;
      if(check(mid,i,dp[i][0]))
        p1=mid,r1=mid-1;
      else
        l1=mid+1;
    }
    int l2=i,r2=n,p2=i;
    while(l2<=r2)
    {
      int mid=(l2+r2)>>1;
      if(check(i,mid,dp[i][0]))
        p2=mid,l2=mid+1;
      else
        r2=mid-1;
    }
    v.pb(pi(dp[i][0],(LL)(i-p1+1)*(LL)(p2-i+1)));
  }
  sort(v.begin(),v.end());
  for(int i=0 ; i<n ; i++)
    sum[i+1]=sum[i]+v[i].se;
  for(int i=0 ; i<m ; i++)
  {
    int numb,pl,pr;
    char com[3],per[3];
    scanf("%s%d%s",com,&numb,per);
    if(com[0]=='<')
    {
      pl=0;
      pr=lower_bound(v.begin(),v.end(),pi(numb,0))-v.begin();
    }
    else if(com[0]=='>')
    {
      pr=n;
      pl=lower_bound(v.begin(),v.end(),pi(numb+1,0))-v.begin();
    }
    else
    {
      pl=lower_bound(v.begin(),v.end(),pi(numb,0))-v.begin();
      pr=lower_bound(v.begin(),v.end(),pi(numb+1,0))-v.begin();
    }
    LL tot=sum[pr]-sum[pl];
    if(tot%2LL)
      printf("%c",per[0]);
    else if(per[0]=='C')
      printf("D");
    else
      printf("C");
  }
  return 0;
}

