int ans;
int type;
void merge(int x,int y,int z,int a[],int d[]) {
	int i = x;
	int j = y+1;
	int ctr = x;
	while (i <= y && j <= z) {
		if (a[i] <= a[j]) {
			d[ctr++] = a[i++];
		}
		else   {
			d[ctr++] = a[j++];
			int temp = (y+1-i);
			if (type == 0)
				ans += 1;
			else if (type == 1)
				ans += temp;
			else 
				ans += temp*temp;
		}
	}
	while (i <= y){
		d[ctr++] = a[i++]; }

	while (j <= z) {
		d[ctr++] = a[j++];

	}
	int l = x;
	while (l <= z) {
		a[l] = d[l];
		l++;
	}
}
void mergesort(int i,int j,int a[],int d[]) {
	if (i < j) {
		int temp = (i+j)/2;
		mergesort(i,temp,a,d);
		mergesort(temp+1,j,a,d);
		merge(i,temp,j,a,d);
	}
}
