        InputReader r=new InputReader(System.in);
        OutputWriter w=new OutputWriter(System.out);
        IOUtils a=new IOUtils();
        int t=r.readInt();
        for(int i=0;i<t;i++){
            n=r.readInt();
            a.readLongArray(r,n,arr);
            res=0;
            solve();
            w.printLine(solve());
        }
        w.close();
    }

    public static long solve(){
        max_seq(); min_seq();
        min1[0]=arr[0]; res=Math.abs(min1[0]-max[1]);
        res=Math.max(res,Math.abs(min1[0]-min[1]));
        max1[0]=arr[0];
        for(int i=1;i<n-1;i++){
            min1[i]=Math.min(arr[i],min1[i-1]+arr[i]);
            max1[i]=Math.max(arr[i],max1[i-1]+arr[i]);
            res=Math.max(res,Math.abs(min1[i]-max[i+1]));
            res=Math.max(res,Math.abs(max1[i]-min[i+1]));
        }
        return res;
    }

    public static void max_seq(){
       long csum=0,tsum=Long.MIN_VALUE+1;
        for(int i=n-1;i>=0;i--){
            csum=csum+arr[i];
            if(csum>tsum){
                max[i]=csum;
                tsum=csum;
            }
            else max[i]=tsum;
            if(csum<0) csum=0;
        }
    }

    public static void min_seq(){
        long csum=0,tsum=Long.MAX_VALUE;
        for(int i=n-1;i>=0;i--){
            csum=csum+arr[i];
            if(csum<tsum){
                min[i]=csum;
                tsum=csum;
            }
            else min[i]=tsum;
            if(csum>0) csum=0;
        }
    }
}

class InputReader {

		private InputStream stream;
		private byte[] buf = new byte[1024];
		private int curChar;
		private int numChars;
		private SpaceCharFilter filter;

		public InputReader(InputStream stream) {
			this.stream = stream;
		}

		public int read() {
			if (numChars == -1)
				throw new InputMismatchException();
			if (curChar >= numChars) {
				curChar = 0;
				try {
					numChars = stream.read(buf);
				} catch (IOException e) {
					throw new InputMismatchException();
				}
				if (numChars <= 0)
					return -1;
			}
			return buf[curChar++];
		}

		public int readInt() {
			int c = read();
			while (isSpaceChar(c))
				c = read();
			int sgn = 1;
			if (c == '-') {
				sgn = -1;
				c = read();
			}
			int res = 0;
			do {
				if (c < '0' || c > '9')
					throw new InputMismatchException();
				res *= 10;
				res += c - '0';
				c = read();
			} while (!isSpaceChar(c));
			return res * sgn;
		}

                public long readLong() {
			int c = read();
			while (isSpaceChar(c))
				c = read();
			long sgn = 1;
			if (c == '-') {
				sgn = -1;
				c = read();
			}
			long res = 0;
			do {
				if (c < '0' || c > '9')
					throw new InputMismatchException();
				res *= 10;
				res += c - '0';
				c = read();
			} while (!isSpaceChar(c));
			return res * sgn;
		}

		public String readString() {
			int c = read();
			while (isSpaceChar(c))
				c = read();
			StringBuilder res = new StringBuilder();
			do {
				res.appendCodePoint(c);
				c = read();
			} while (!isSpaceChar(c));
			return res.toString();
		}

		public boolean isSpaceChar(int c) {
			if (filter != null)
				return filter.isSpaceChar(c);
			return c == ' ' || c == '\n' || c == '\r' || c == '\t' || c == -1;
		}

		public String next() {
			return readString();
		}

		public interface SpaceCharFilter {
			public boolean isSpaceChar(int ch);
		}
	}

class OutputWriter {
		private final PrintWriter writer;

		public OutputWriter(OutputStream outputStream) {
			writer = new PrintWriter(new BufferedWriter(new OutputStreamWriter(outputStream)));
		}

		public OutputWriter(Writer writer) {
			this.writer = new PrintWriter(writer);
		}

		public void print(Object...objects) {
			for (int i = 0; i < objects.length; i++) {
				if (i != 0)
					writer.print(' ');
				writer.print(objects[i]);
			}
		}

		public void printLine(Object...objects) {
			print(objects);
			writer.println();
		}

		public void close() {
			writer.close();
		}

		public void flush() {
			writer.flush();
		}

		}

