#define LD (long double)

int n;

long double mem(int i, int j){
	if(visit[i][j])
		return LD dp[i][j];
	visit[i][j] = true;
	if(i == j){
		dp[i][j] = v[i];
		return LD dp[i][j];
	}

	if((turnEven && (n-(j-i))%2 == 0) || (!turnEven && (n-(j-i))%2))
		dp[i][j] = (LD mem(i+1,j) + LD mem(i,j-1) + LD v[i] + LD v[j]);
	else
		dp[i][j] = LD mem(i+1,j) + LD mem(i,j-1);
	dp[i][j] = LD dp[i][j] * (long double)(0.5);

	return LD dp[i][j];
}

