int main(){
    int t;
    cin >> t;
    while(t--){
        int n,ans=0;
        map <int,int> ct;
        map <int,int> check;
        cin >> n;
        for(int i = 0; i < n; i++){
            cin >> a[i];
        }
        for(int i = 0; i < n; i++){
            ct[a[i]]++;
            check[a[i]]=0;
        }
        for(int i = 0; i < n; i++){
            if(!check[a[i]]){
                pq.push(ct[a[i]]);
                check[a[i]]=1;
            }
        }
        while(!pq.empty()){
            if(pq.size()==1){
                ans+=pq.top();
                pq.pop();
            }else{
                while(pq.top()==0 && !pq.empty()) pq.pop();
                if(!pq.empty()){
                    int cur = pq.top();
                    pq.pop();
                    int c2 = pq.top();
                    pq.pop();
                    c2-=cur;
                    pq.push(c2);
                    ans++;
                }
            }
        }
        cout << ans << endl;
    }
}

