   static  int solve(int n[])
    {
        int c = 0;
        try
        {
        int l1 = 1;
        int l = n.length;
        int flag = n[0];
        for (int i = 1; i < l; i++)
        {
            if (n[i] != flag) {
                l1++;
                flag = n[i];
            }
        }
        int a[] = new int[l1];
        l1 = 0;
        for (int i = 0; i < l; i++)
        {
            for (int j = 0; j < l; j++)
            {
                if (n[i] == n[j] && n[i] >= 0)
                {
                    c++;
                   if(c>1)
                       n[j] = -1;
                }

            }
            if (c > 0)
            {
                a[l1] = c;
                l1++;
            }
            c = 0;
        }

        Arrays.sort(a);
            if(l1==1)
                return a[0];

        for (int i = 0; i < l1 / 2; i++)
        {
            int t = a[i];
             a[i]=a[l1-1-i];
            a[l1-1-i] = t;
        }
            while(a[1]!=0)
            {

                c=c+a[1];
                a[0]=a[0]-a[1];a[1]=0;
                Arrays.sort(a);

                for (int i = 0; i < l1 / 2; i++)
                {
                    int t = a[i];
                    a[i]=a[l1-1-i];
                    a[l1-1-i] = t;
                }
                if(a[1]==0)
                    c=c+a[0];

            }

        }
        catch(ArrayIndexOutOfBoundsException e){}
        return c;
    }

}

