#include <bits/stdc++.h>
using namespace std;
static int dp[100000001];
int solve(long long int x)
{
    if(x==1)
        return 0;
    if(dp[x]!=-1)
        return dp[x];
    int flag=0;
    for(long long int i=2;i*i<=x;i++){
        if(x%i==0){
            flag|=(1^solve(i));
            if(flag){
                dp[x]=1;
                return 1;
            }
            flag|=(1^solve(x/i));
            if(flag){
                dp[x]=1;
                return 1;
            }
        }
    }
    flag|=solve(x-1)^1;
    dp[x]=flag;
    return dp[x];
}
int main(){
    memset(dp,-1,sizeof(dp));
    int t;
