	cin>>T;

	long long int m1, m2 ,ans = 0, up, up_e, down_e , start_up; 

	while(T--){
		scanf("%lld %lld",&N,&M);
		m1 = N/M;
		m2 = (2*N)/M;

		up_e = down_e = 0 ;
		up = m2- m1; 
		start_up = m1 + M;

		if(M<=N){
			if(M%2){
				down_e = m1/2;
			}else
				down_e = m1;
		}

		if(M%2 == 0){
			up_e = up;
		}else{
			if(start_up%2 == 0 && up %2 == 0)
				up_e = up/2 +1;
			else
				up_e = up/2;
		}

		ans = M*(m1*(m1+1)/2)/2;
		ans += (m2-m1)*N - M*(m2*(m2+1)/2 - m1*(m1+1)/2)/2 - down_e - (m1-down_e)/2 - (up-up_e)/2;

		printf("%lld\n",ans);
	}

	return 0;	
