using namespace std;
#define MAX 100001
vector <int> factors[MAX];
vector <int> bucket[MAX];
struct query 
{
	int id, L, R;
};
vector <query> v1[MAX];
int tree[MAX];
int a[MAX];
void update (int idx, int val)
{
	while (idx < MAX)
	{
		tree[idx] += val;
		idx += idx & (-idx);
	}
}
int read (int idx)
{
	int val = 0;
	while (idx > 0)
	{
		val += tree[idx];
		idx -= idx & (-idx);
	}
	return val;
}
void storeFactors ()
{
	for (int i = 1; i < MAX; i++)
	{
		for (int j = i; j < MAX; j += i)
		{
			factors[j].push_back (i);
		}
	}
}
int main()
{
	int N, Q;
	scanf ("%d%d",&N,&Q);
	storeFactors();
	for (int i = 1; i <= N; i++)
	{
		scanf ("%d",&a[i]);
		for (int j = 0; j < factors[a[i]].size(); j++)
		{
			int b = factors[a[i]][j];
			bucket[b].push_back (i);
		}
	}
	int a, b, k;
	for (int i = 1; i <= Q; i++)
	{
		scanf ("%d%d%d",&a,&b,&k);
		query q;
		q.id = i;
		q.L = a;
		q.R = b;
		v1[k].push_back (q);
	}
	int ans[Q+1];
	memset (ans, 0, sizeof (ans));
	for (int i = 1; i < MAX; i++)
	{
		//cout << bucket[i].size() << " \n "; 
		for (int j = 0; j < bucket[i].size(); j++)
		{
			//cout << "jii\n";
			update (bucket[i][j], +1);
		}
		for (int j = 0; j < v1[i].size(); j++)
		{
			//cout << "hiii\n";
			query q = v1[i][j];
			int ID = q.id;
			int A = q.L;
			int B = q.R;
			//cout << ID << " " << A << " " << B << "\n";
			ans[ID] = read (B) - read (A-1);
		}
		//cout << "hii\n";
		for (int j = 0; j < bucket[i].size(); j++)
		{
			update (bucket[i][j], -1);
		}

	}
	for (int i = 1; i <= Q; i++)
	{
		printf("%d\n",ans[i]);
	}
	return 0;
}

