public class Main implements Runnable {

        class Pair implements Comparable<Pair>{
            int v, id;
            Pair(int v, int id){
                this.v = v;
                this.id = id;
            }
            public int compareTo(Pair b){
                if(v != b.v)
                    return v - b.v;
                return id - b.id;
            }
        }

	public void solve() throws IOException {
		int n = nextInt();
                int k = nextInt();

                Pair[] p = new Pair[n];
                for(int i = 0; i < n; i++){
                    p[i] = new Pair(nextInt(), i);
                }

                Arrays.sort(p);
                int i = 0;
                int answer = 0;
                while(i < n){
                    int j = i+1;
                    while(j < n && p[i].v == p[j].v && p[j].id - p[i].id < k) j++;
                    i = j;
                    answer++;
                }

                out.println(answer);
        }



















