#define ll long long int

ll gcd(ll a, ll b)
{
	return b==0?a:gcd(b,a%b);
}

ll lcm(ll g1, ll g2)
{
	ll temp = g1/gcd(g1,g2);
	temp*=g2;
	return temp;
}

