map<LL, vector<int> > d;
LL mul(LL a, LL b) {
	LL res = 0;
	while(b > 0) {
		if (b & 1) {
			res += a;
			res %= B;
		}
		a += a;
		a %= B;
		b >>= 1;
	}
	return res;
}
LL binpow(LL a, LL b) {
	LL res = 1;
	while(b > 0) {
		if (b & 1) {
			res = mul(res,a);
		}
		a = mul(a,a);
		b >>= 1;
	}
	return res;
}
void dfs(int p, LL mod) {
	if (p == n) {
		if (mod == G) {
			for (int i = 0; i < n; i++) {
