			}
			cout << endl;
			exit(0);
		}
		return;
	}
	for (int i = 0; i < 10; i++) {
		c[p] = i;
		dfs(p + 1,(mul(mod,A) + i) % B);
	}
}
void go(int p, LL mod) {
	if (p == m) {
		if (d.count(mod) == 0) {
			vector<int> cur(m);
			for (int i = 0; i < m; i++) {
				cur[i] = c[i];
			}
			d[mod] = cur;
		}
		return;
	}
	for (int i = 0; i < 10; i++) {
		c[p] = i;
		go(p + 1,(mul(mod,A) + i) % B);
	}
