using namespace std;

int bfs(vector<vector<int> > B,string str,int n){
	queue<int> q;
	queue<int> len;
	bool visited[n+1];

	for(int i=1;i<=n; i++)
		visited[i] = false;

	q.push(1);
	len.push(0);
	visited[1] = true;
	int cur;

	while(!q.empty()) {
		int thisLen = len.front();
		int i = q.front();
		cur = i;

		if(cur == n) return thisLen;
		else {
			int temp = str[i-1] - '0';
			for(int j=0; j<B[temp].size(); j++) {
				if(visited[B[temp][j]] == false) {
					if(B[temp][j] == n) return thisLen+1;

					visited[B[temp][j]] = true;
					q.push(B[temp][j]);
					len.push(thisLen+1);

				}
			}

			B[temp].clear();
			if(cur != 1) {
				if(visited[i-1] == false) {
					visited[i-1] = true;
					q.push(i-1);
					len.push(thisLen+1);
				}
			}

			if(visited[i+1] == false) {
				visited[i+1] = true;
				q.push(i+1);
				len.push(thisLen+1);
			}

			q.pop();
			len.pop(); 
		}
	}

	return -1;
}

int main()
{
	vector<vector<int> > B(10);
	char *str;

	scanf("%s",str);
	int n = strlen(str);

	for(int i=0; i<n; i++) {
		int y = str[i] - '0';
		B[y].push_back(i+1);
	}

	int res = bfs(B,str,n);
	printf("%d\n",res);

	return 0;
}

