using namespace std;
#define MAX 100001
int pos[10][MAX];
int posIndex[10]={0};
int adj[MAX];
string s;
int getAdjacentList(int n, int len){
	int i,temp,k=-1;
	if(n>0)
		adj[++k]=n-1;
	if(n<len-1)
		adj[++k]=n+1;	
	temp=(int)s[n]-48;
	for(i=0;i<posIndex[temp];++i)
		adj[++k]=pos[temp][i];
	return ++k;
}
int BFS(int V){
	bool visited[V], flag=false;
	int jumps=0,n=0,i,j,prev[V];
	int adjLen;
	for(i=0;i<V;++i)
		visited[i]=false;

	visited[n]=true;
	queue<int> q1,q2;
	q1.push(n);
	while(!q1.empty() || !q2.empty()){
		while(!q1.empty()){
			n=q1.front();
			q1.pop();
			if(n==(V-1)){
				flag=true;
				break;
			}
			adjLen=getAdjacentList(n, V);
			for(j=0;j<adjLen;++j){
				if(adj[j]==(V-1)){
					++jumps;
					flag=true;
					break;
				}
				if(!visited[adj[j]]){
					visited[adj[j]]=true;
					q2.push(adj[j]);
				}
			}
			if(flag)
				break;
		}
		if(flag)
			break;
		++jumps;
		while(!q2.empty()){
			n=q2.front();
			q2.pop();
			if(n==(V-1)){
				flag=true;
				break;
			}
			adjLen=getAdjacentList(n, V);
			for(j=0;j<adjLen;++j){
				if(adj[j]==(V-1)){
					++jumps;
					flag=true;
					break;
				}
				if(!visited[adj[j]]){
					visited[adj[j]]=true;
					q1.push(adj[j]);
				}
			}
			if(flag)
				break;
		}
		if(flag)
			break;
		++jumps;
	}
	return jumps;
}

