#include<iostream>
#include<cstring>
#include<vector>
#include<queue>
using namespace std;
bool visited[100005];
int dist[100005];
queue<int> Q;
vector<int> vec[10];
char str[100005];
int main()
{
	memset(visited,0,sizeof(visited));
	scanf("%s",str);
	int len = strlen(str);
	for(int i=0;i<len;i++)
	{
		int val = str[i]-'0';
		vec[val].push_back(i);
	}
	Q.push(0);
	visited[0]=true;
	dist[0]=0;
	while(!Q.empty())
	{
		int id = Q.front();
		if(id == len-1) break;
		Q.pop();
		int val = str[id]-'0';
		int size = vec[val].size();
		for(int j=0;j<size;j++)
		{
			int ni = vec[val][j];
			if(!visited[ni])
			{
				visited[ni]=1;
				Q.push(ni);
				dist[ni] = dist[id]+1;
			}
		}
		vector[val].clear();
		if(id-1>=0 && !visited[id-1])
		{
			visited[id-1]=true;
			Q.push(id-1);
			dist[id-1] = dist[id]+1;
		}
		if(id+1<len && !visited[id+1])
		{
			visited[id+1]=true;
			Q.push(id+1);
			dist[id+1] = dist[id]+1;
		}
	}
	printf("%d",dist[len-1]);
}

import java.io.*;
import java.util.StringTokenizer;
class COMM3
{
	public static void main(String args[])throws IOException
	{
		BufferedReader br=new BufferedReader(new InputStreamReader(System.in));
		int t=Integer.parseInt(br.readLine());
		double[][] d=new double[3][2];
		double d1=0, d2=0, d3=0, r=0;
		StringTokenizer st;
		for(int j=1;j<=t;j++)
		{
			r=Double.parseDouble(br.readLine());
			for(int i=0;i<3;i++)
			{
				st=new StringTokenizer(br.readLine());
				d[i][0]=Double.parseDouble(st.nextToken());
				d[i][1]=Double.parseDouble(st.nextToken());
			}
			d1=getDistance(d[0][0], d[0][1], d[1][0], d[1][1]);
			d2=getDistance(d[1][0], d[1][1], d[2][0], d[2][1]);
			d3=getDistance(d[2][0], d[2][1], d[0][0], d[0][1]);

			if(check(d1, d2, d3, r)) System.out.println("yes");
			else System.out.println("no");
		}


	}

	static boolean check(double d1, double d2, double d3, double r)
	{
		int f=0;
		if(d1<=r) f++;
		if(d2<=r) f++;
		if(d3<=r) f++;
		return f>=2;
	}

	static double getDistance(double x1, double y1, double x2, double y2)
	{
		double k=Math.pow(x1-x2, 2);
		double l=Math.pow(y1-y2, 2);
		return Math.sqrt(k+l);
	}
}

