typedef struct MODIFICATION {
  int pos;
  int change;

  bool operator<(MODIFICATION x) const
  {
    return pos<x.pos;
  }
} MODIFICATION;

MODIFICATION ms[20001];

int compare (const void * a, const void * b)
{
  return ( (*(MODIFICATION*)a).pos - (*(MODIFICATION*)b).pos );
}

int main()
{
  int t, n, s;
  cin>>t;

  while(t--)
  {
      int w, x, y, z;
    int s;
    cin>>s>>n;
    int mn = 1;
    int mx = s;    
    for(int i=0;i<n;i++)
    {
      cin>>w;
      cin>>x;
      cin>>y;
      cin>>z;

      if(w==2)
	z = -z;

      ms[2*i].pos = x;
      ms[2*i].change = z;

      ms[2*i+1].pos = y+1;
      ms[2*i+1].change = -z;
    }



      sort(ms, ms+(2*n));

      int val=0;
      int cur=1;
      for(int i=0;i<2*n;i++)
      {
	if(ms[i].pos > cur){
	mn = min(mn, cur+val);
	mx = max(mx , ms[i].pos-1+val);
	cur = ms[i].pos;
	}
	val+=ms[i].change;

      }

      cout<<(mx-mn)<<endl;
  }


  return 0;
}

