using namespace std;

bool isOkay(int *arr, int n);

int main()
{
    int t;
    cin>>t;

    int n;
    long long int total;
    long long int cost;
    int difference, realDiff;
    bool trueFalse;
    int counter;

    for(int l=0;l<t;l++)
    {
        cin>>n;

        int arr[n];
        total = 0;

        for(int i=0;i<n;i++)
        {
            cin>>arr[i];
            total+=arr[i];
        }

        if(total%n!=0)
        {
            cout<<"-1"<<endl;
        }
        else
        {
            sort(arr,arr+n);
            cost = 0;
            counter = n-1;
            for(int i=0;i<n;i++)
            {
                difference = (double)arr[counter] - (double)arr[i];
                difference = difference/2;
                realDiff = ceil(difference);

                if(arr[i]!=arr[counter]&&i!=counter)
                {
                    cost++;
                    arr[counter]-=realDiff;
                    arr[i]+=realDiff;
                }

                counter--;

                if(i==counter)
                {
                    break;
                }
            }

            if(isOkay(arr,n))
            {
                trueFalse = true;
            }

            if(trueFalse)
            {
                cout<<cost<<endl;
            }
            else
            {
                cout<<"-1"<<endl;
            }
        }
    }
}



bool isOkay(int *arr, int n)
{
    int result = arr[0];

    for(int i=1;i<n;i++)
    {
        if(arr[i]!=result)
        {
            return false;
        }
    }

    return true;
}

