{
	long long int ans;
	if(i==1 && q==1)
	{
		ans=(n-1)/2;
	}
	else if(i==1 && q==2)
	{
		ans=(n+1)/2;
	}
	else if(i==2 && q==1)
	{
		ans=(n+1)/2;
	}
	else
	{
		ans=(n-1)/2;
	}
	return ans;
}
