int grundy(int pos)
{
    //cout<<pos<<endl;
    if(dp[pos]!=-1)
        return dp[pos];
    set<int> s;
    int i=1;
    while(pos-p[i]>=0)
    {
        s.insert(grundy(pos-p[i]));
        i++;
    }
    int ret=0;
    while(s.find(ret)!=s.end())
        ret++;
    return dp[pos]=ret;
}

