//--------------------------------------------------

  // returns x from 1 to m-1 such that m divides a*x-1
  // precondition gcd(a, m) = 1
  ll inv(ll a, ll m) {
    ll x0 = 1, x1 = 0;
    ll b = m;
    while (b > 0) {

      ll q = a / b;

      // (a; b) := (b; a - q * b)
      ll c = a - q * b;
      a = b;
      b = c;

      // (x0; x1) := (x1; x0 - q * x1)
      ll x = x0 - q * x1;
      x0 = x1;
      x1 = x;
    }
    return x0 < 0 ? x0 + m : x0;
  }

    // returns A^N mod M
  // exponentiation by squaring
  int powmod(int A, int N, int M) {
    int res = 1;
    while (N > 0) {
      if (N % 2 == 1) {
        res = (ll)res * A % M;
      }
      N /= 2;
      if (N > 0) {
        A = (ll)A * A % M;
      }
    }
    return res;
  }

