ll solve_large() { // number of sub-arrays <= 20,000,100,000; S <= 2,000,000; 20,000 < N  200,000

	const int S = accumulate(A,A+N,0ll);

	assert(S <= 2000000);

	int n = 1;
	while(n < (S+1)) n <<= 1;
	n <<= 1;

	vector<base> xx(n), yy(n);	
//	vector<int> xx(n), yy(n);	
	int s = 0;

	rep(i,N+1) {
		xx[s] = base(1,0);
		yy[S-s] = base(1,0);
		s += A[i];
	}

	double angle = 2*M_PI/n;
	base delta(cos(angle), sin(angle));

	fft(&xx[0],0,n,delta);
	fft(&yy[0],0,n,delta);	

	rep(i,n) xx[i] *= yy[i];
	angle = -angle;
	delta = base(cos(angle), sin(angle));

	fft(&xx[0],0,n,delta);
	rep(i,n) xx[i] /= n;

//	rep(i,N+1) {
//		x[s] = 1;
//		y[S-s] = 1;
//		s += A[i];
//	}
//
//	convolution(S+1,S+1);
//    int res=0;
//    for(int i=0;i<S;i++) if(c[i]) res++;
//	return res;

//	rep(i,N+1) {
//		xx[s] = 1;
//		yy[S-s] = 1;
//		s += A[i];
//	}
//	
//	fft(xx,false);
//	fft(yy,false);	
//	rep(i,n) xx[i] = int(xx[i] * 1ll * yy[i] % mod);
//	fft(xx,true);

	int ans = 0;

	rep(i,S) {
		ll t = ll(xx[i].real()+0.5);
		//int t = x[i];
		if(t>0) ++ans;
	}

	return ans;
}

