int main() {
    int t;
    cin>>t;
    while(t--) {
        int n, m;
        int p, q, c, mask;

        cin>>n>>m;
        int dp1[1<<n], dp2[1<<n];
        fill(dp1, dp1+(1<<n), 1<<30);
        fill(dp2, dp2+(1<<n), 1<<30);
        dp1[0] = dp2[0] = 0;
        for(int i=0; i<n; i++) {
            cin>>c;
            dp1[1<<i] = c;
        }
        for(int i=0; i<m; i++) {
            cin>>c>>q;
            mask = 0;
            for(int j=0; j<q; j++) {
                cin>>p;
                mask = mask | (1<<(p-1));
            }
            dp1[mask] = min(dp1[mask],c);
        }

        for(int i=(1<<n)-1; i>=0; i--) {
            for(int j = i & (i-1); ;j = i&(j-1)) {
                dp1[j] = min(dp1[j], dp1[i]);
                if(j==0)
                    break;
            }
        }

        for(int i=1; i<(1<<n); i++)
            for(int j = i & (i-1); ;j = i&(j-1)) {
                dp2[i] = min(dp2[i], dp2[j]+dp1[i^j]);
                if(j==0)
                    break;
            }

        cout<<dp2[(1<<n)-1]<<endl;
    }

    return 0;
}

