using namespace std;

void scanint(int &x)
{
    register int c = getchar_unlocked();
    x = 0;
    int neg = 0;
    for(;((c<48 || c>57) && c != '-');c = getchar_unlocked());
    if(c=='-') {neg=1;c=getchar_unlocked();}
    for(;c>47 && c<58;c = getchar_unlocked()) {x = (x<<1) + (x<<3) + c - 48;}
    if(neg) x=-x;
}
void writeint (int n)
    {
        int N = n, rev, neg=0,count = 0;
        rev = N;
        if(n<0)
        {
            neg=1; n*=-1; N*=-1; rev*=-1;
            putchar_unlocked('-');
        }
        if (N == 0) { putchar_unlocked('0'); putchar_unlocked('\n'); return ;}
        while ((rev % 10) == 0) { count++; rev /= 10;} 
        rev = 0;
        while (N != 0) { rev = (rev<<3) + (rev<<1) + N % 10; N /= 10;}
        while (rev != 0) { putchar_unlocked(rev % 10 + '0'); rev /= 10;}
        while (count--) putchar_unlocked('0');
    }
int main() {
    int t;
    scanint(t);
        int a[t],b[t];
        for(int i=0;i<t;i++)
        {
            scanint(a[i]);
            scanint(b[i]);
        }
        int max=0,maxper=1;
        for(int i=0;i<t;i++)
        {
            if(abs(a[i]-b[i])>max)
            {
                max=abs(a[i]-b[i]);
                if(a[i]>b[i])
                maxper=1;
                else
                maxper=2;
            }
        }
        writeint(maxper);
        putchar_unlocked(' ');
        writeint(max);
        putchar_unlocked('\n');
	return 0;
}

