#define gc getchar_unlocked
typedef long long LL;
LL get_i(){
	char c=gc();
	while(c<'0' || c>'9') c=gc();
	LL ret=0;
	while(c>='0' && c<='9'){
		ret=(ret<<3)+(ret<<1)+c-'0';
		c=gc();
	}
	return ret;
}
