// ---------Fast IO using getchar----------
int getint()
{
    int c = 'a';
    while (!(c >= '0' && c <= '9') && c != '-')
        //c = getchar_unlocked();
        c = getchar();
    int c2;
    if (c != '-')
        c2 = c;
    else
        c2 = '0';
    int res = 0;
    while((c2 >= '0' && c2 <= '9'))
    {
        res = (res << 3) + (res << 1) + (c2 - '0');
        //c2 = getchar_unlocked();
        c2 = getchar();
    }
    return res * (c == '-' ? -1 : 1);
}
