//The Lead Game
#include<stdio.h>
int main()
{
	typedef struct
	{
		int p1,p2,lead,leader;
	}round;

	int i,n,max=0,add;
	scanf("%d",&n);
	round arr[n];

	for(i=0;i<n;i++)
	{
		scanf("%d",&arr[i].p1);
		scanf("%d",&arr[i].p2);	
		if(arr[i].p1>arr[i].p2)
		{
			arr[i].lead=arr[i].p1-arr[i].p2;
			arr[i].leader=1;
		}
		else if(arr[i].p1<arr[i].p2)
		{
			arr[i].lead=arr[i].p2-arr[i].p1;
			arr[i].leader=2;
		}

		if(max<arr[i].lead)
		{
			max=arr[i].lead;
			add=i;
		}
	}

	printf("%d %d",arr[add].leader,arr[add].lead);
	return 0;
}

