import java.util.*;
import java.math.*;


public class Main  {

public static void mergeSort(int[] arr, int l, int n){
	if(l < n){
		int m = (l + n) / 2;
		mergeSort(arr, l, m);
		mergeSort(arr, m + 1, n);
		merge(arr, l ,m, n);

	}
}

public static void merge(int[] arr, int l, int m, int n){
	int nl = m - l + 1;
	int nr = n - m;
	int[] L = new int[nl];
	int[] R = new int[nr];

	for(int i = 0; i < nl; i++)
		L[i] = arr[l + i];	
	for(int i = 0; i < nr; i++)
		R[i] = arr[m + i + 1];

	int x = 0;
	int y = 0;
	int z = l;
	while(x < nl && y < nr){


		if(L[x] < R[y]){
			arr[z] = L[x];
			x++;

		}

		else{
			arr[z] = R[y];
			y++;

		}

		z++;

	}

	while(x < nl){

		arr[z] = L[x];
		x++;
		z++;
	}

	while(y < nr){

		arr[z] = R[y];
		y++;
		z++;
	}


}

