#include<bits/stdc++.h>
using namespace std;
int ar[1000010];
void swap(int *a,int *b)
{
    int temp=*a;
    *a=*b;
    *b=temp;
}
void heapify(int ar[],int m,int n)
{
    int k=m*2;
    if(k+1<=n)
    {
        if((ar[k]>ar[m])&&(ar[k]>ar[k+1]))
        {
            swap(&ar[k],&ar[m]);
            heapify(ar,k,n);
        }
        if((ar[k+1]>ar[m])&&(ar[k+1]>=ar[k]))
        {
            swap(&ar[k+1],&ar[m]);
            heapify(ar,k+1,n);
        }

    }
    else
    {
        if(k<=n&&ar[k]>ar[m])
        {
            swap(&ar[k],&ar[m]);
            //heapify(ar,k,n);
        }
    }
}
void maxheap(int ar[],int n)
{
    for(int i=n/2; i>=1; i--)
        heapify(ar,i,n);
}
void heapsort(int ar[],int n)
{
    maxheap(ar,n);
    swap(&ar[1],&ar[n]);
    for(int i=n-1; i>=1; i--)
    {
        heapify(ar,1,i);
        swap(&ar[1],&ar[i]);
    }
}
int main()
{
    int n;
    cin>>n;
    for(int i=1; i<=n; i++)
        scanf("%d",&ar[i]);
    heapsort(ar,n);
    for(int i=1; i<=n; i++)
        printf("%d\n",ar[i]);
}

