#include<iostream>
using namespace std;
int partition(int *a,int start,int end)
{
int pivot=a[end];
int j=start;
int temp;
for(int i=start;i<end;i++)
{
    if(a[i]<=pivot)
    {
        temp=a[i];
        a[i]=a[j];
        a[j]=temp;
        j=j+1;
    }
}temp=a[j];
 a[j]=pivot;
 a[end]=temp;
return j;
}
void quick_sort(int *a,int start,int end)
{
    if(start<end)
    {
    int j=partition(a,start,end);
    quick_sort(a,start,j-1);
    quick_sort(a,j,end);
    }
}

