void tsort(int a[], int len)
{
        int i, j, temp;
        for(i = 0; i < len; i++){
                for(j = 0; j < i; j++){
                        if(a[i] < a[j]){
                                temp = a[j];
                                a[j] = a[i];
                                a[i] = temp;
                        }
                }
        }
}

