void count(int a[],int high,int size){
    int b[high],c[size];
    int i,j=0;
    for(i=0;i<high;i++)
        b[i]=0;
    for(i=0;i<size;i++)
        b[a[i]]=b[a[i]]+1;
    for(i=0;i<high;i++){
        while(b[i]>0){
            a[j]=i;
            b[i]--;
            j++;
        }
    }

}

