int left(int i) {return 2*i+1;}

int right(int i) {return 2*i+2;}

void Max_Heapify(int A[],int i,int n)
{
	int l,r,largest;
	l = left(i);
	r = right(i);

	if(l < n && A[l] > A[i])
		largest = l;
	else
		largest = i;
	if(r < n && A[r] > A[largest])
		largest = r;

	if(largest != i)
	{
		swap(&A[i],&A[largest]);
		Max_Heapify(A,largest,n);
	}
}

void printHeap(int A[],int n)
{
	int i;
	for(i =0; i<n; i++)
		printf("%d\n",A[i]);
}

void swap(int *a,int *b)
{
	int t;
	t= *a;
	*a = *b;
	*b=t;
}

void Build_Max_Heap(int A[],int n)
{
	int i;
	for(i = n/2-1; i >= 0; i--)
	{
		Max_Heapify(A,i,n);
	}
}

void sort(int A[], int n)
{
	int i;
	Build_Max_Heap(A,n);
	for(i=n-1 ; i >= 0 ; i--)
	{
		swap(A[0],A[i]);
		Max_Heapify(A,0,i);	

	}
}

