#define SIZE 1000000
void scanint(long *);
long temp[SIZE]={0};
int main()
{
	long t;
	scanint(&t);
	long input[t],output[t],i=1,count=t;
	while(count--)
	{
		long userInput;
		scanint(&userInput);
		input[i]=userInput;
		i++;
	}
	for(i=1;i<=t;i++)
		temp[input[i]]++;
	for(i=1;i<=SIZE;i++)
		temp[i]=temp[i]+temp[i-1];
	for(i=t;i>=1;i--)
	{
		output[temp[input[i]]] = input[i];
		temp[input[i]]--;
	}
	for(i=1;i<=t;i++)
		printf("%ld\n",output[i]);
	return 0;

}

