// sorting function

void sort(int a[], int n) {
	int i, j, k;
	for(i = 1; i < n; i++){
		k = a[i];
		for(j = i-1; (j >= 0) && (a[j] > k); j--) {
			a[j+1] = a[j];
		}
		a[j+1] = k;
	}
}

