#include<stdio.h>
int ary[1000000];
void swap(long *a,long *b)
{
	*a=*a+*b;
	*b=*a-*b;
	*a=*a-*b;
}
void heapify(long,long);
void createheap(long k)
{	long i;
	for(i=k-1;i>=0;i--)
	{	heapify(i,k);
	}
	return;
}
void heapify(long a,long n)
{	long l,r,lr;
	l=2*a+1;
	r=l+1;
	if(l<=n && ary[l]>ary[a])
		lr=l;
	else
		lr=a;
	if(r<=n && ary[r]>ary[lr])
		lr=r;
	if(lr!=a)
	{	swap(ary+a,ary+lr);
		heapify(lr,n);
	}
}
void heapsort(long n)
{	long i,j;
	createheap(n);
	printf("\n");
	for(i=n-1;i>0;i--)
	{	swap(ary,ary+i);
		heapify(0,i-1);
		for(j=0;j<n;j++)
			printf("%d ",ary[j]);
		printf("\n");
	}
}
