void merge(int * arr1, int n1, int n){
	int temp[n];

	int it1 = 0, it2 = n1;
	int i;
	for (i = 0 ; it1 != n1 && it2 != n ; i++){		
		if (arr1[it1] >= arr1[it2]){
			temp[i] = arr1[it2];
			it2++;	
		}	
		else{
			temp[i] = arr1[it1];
			it1++;		
		}
	}	

	if (it1 == n1){
		for (int j = 0 ; j < it2 ; i++)
			arr1[i] = temp[i];	

		return;
	}

	if (it2 == n){
		for (int j = i ; j < n ; j++){			
			temp[j] = arr1[it1];		
			it1++;
		}
	}

	for (int i = 0 ;i  < n ; i++)
		arr1[i] = temp[i];
}

void bsort(int * arr, int n){
	if (n == 1)
		return;

	bsort(arr, n/2);
	bsort(arr + n/2, n - n/2);

	merge(arr, n/2, n);
}

